import React from "react";
import Certificate_1 from "./assets/certif-1.png";
import Certificate_2 from "./assets/certif-2.png";



const Certif=()=>{
    return(
      <>
      <div className="container">
      <a href="" target="_blank" ><img src={Certificate_1} className="logos" /> </a>
      <a href="" target="_blank" ><img src={Certificate_2} className="logos" /> </a>

      </div>
      </>
    );
}
export default Certif;
